const initialState = []

const membersReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_MEMBERS':
            return {
                ...state,
                members: action.members.members
            }
        default:
            return {
                ...state
            }
    }
}

export default membersReducer
